import Mainpage from "./Mainpage/Mainpage/Mainpage";
import Sidebar from "./Sidebar/Sidebar/Sidebar";
import Footer from "./Footer";
import app_styles from "./app.module.scss";
import { HashRouter, Route, Routes } from "react-router-dom";

import UseState from "../src/Mainpage/Hooks/UseState/UseState";
import UseRef from "../src/Mainpage/Hooks/UseRef/UseRef";

const Router = () => (
  <Routes>
    <Route path="/introduce" element={<UseState />} />
    {/* <Route path="/" element={<React_intro />} /> */}
  </Routes>
);

function App() {
  return (
    <div className="App">
      <div className={app_styles.layout1}>
        <Sidebar />
        <Mainpage />
      </div>
      <div className={app_styles.layout2}>
        <Footer />
      </div>

      <HashRouter>
        <Router />
      </HashRouter>
    </div>
  );
}

export default App;
